import React from "react";
import NavigationBar from "../../components/NavigationBar/NavigationBar";
import PageTitle from "../../components/PageTitle/PageTitle";
import "./../../App.css";
import "./Discover.css";
import DisplayUsers from "../../components/DisplayUsers/DisplayUsers";
import Parse from "parse";

export default function Discover(props) {
  clearChatUsers();

  async function clearChatUsers() {
    const selectedUsersQuery = new Parse.Query("ChatUsers");
    const selectedUsersQueryResult = await selectedUsersQuery.first();
    selectedUsersQueryResult.destroy();
  }
  return (
    <div className="discover-page">
      <header>
        <div>
          <div>
            <PageTitle title="Discover" logo={true} />
          </div>
        </div>
      </header>

      <div className="people">
        <div className="title">Discover people</div>
      </div>
      <div className="user-list">
        <DisplayUsers
          setChatUsers={props.setChatUsers}
          displayMode="discover"
        />
      </div>

      <div className="people">
        <div className="title">Group chats</div>
      </div>
      <div>{/*Insert group chats here*/}</div>

      <div className="centering">
        <NavigationBar
          discover={"active"}
          chat={"idle"}
          settings={"idle"}
          profile={"idle"}
        />
      </div>
    </div>
  );
}
